import { NavLink } from 'react-router-dom'

const Item = ({disco}) => {

	return (

		<div className="single-card" key={disco.id}>

			<p><strong>{disco[0].artist}</strong></p>
			<p>{disco[0].record}</p>
			<img src={`/${disco[0].img}`} alt={`${disco[0].artist} - ${disco[0].record}`} />

			<NavLink to={`/item/${disco[0].id}`} className="button-link">Ver detalles</NavLink>

		</div>
	)
}

export default Item
